package com.cablevision.edp.bo;

import java.io.Serializable;
import java.util.Date;

public class DDPAuditResult implements Serializable{
	
	/**
	 * Auto generated serial id
	 */
	private static final long serialVersionUID = -7313495474203522625L;
	private String tableName;
	private long maxSequence;
	private Date loadEndDate;
	
	public String getTableName() {
		return tableName;
	}
	public void setTableName(String tableName) {
		this.tableName = tableName;
	}
	public long getMaxSequence() {
		return maxSequence;
	}
	public void setMaxSequence(long l) {
		this.maxSequence = l;
	}
	public Date getLoadEndDate() {
		return loadEndDate;
	}
	public void setLoadEndDate(Date loadEndDate) {
		this.loadEndDate = loadEndDate;
	}
	
	@Override
	public String toString() {
		StringBuffer sb = new StringBuffer();
		sb.append("DDPAuditResult for tableName ["+ getMaxSequence() +"] maxSequence ["+ getMaxSequence() +"] loadEndDate ["+ getLoadEndDate() +"]");
		return sb.toString(); 
	}

}
